let base64PDF =
  ""
  |> Jstr.of_string

let raw = Brr.Base64.decode base64PDF |> Result.get_ok
let raw = Brr.Base64.data_to_binary_jstr raw
let raw = Brr.Tarray.of_binary_jstr raw |> Result.get_ok

let _ =
  let open Fut.Syntax in
  let src = Pdfjs_ocaml.Array raw in
  let* pdf =
    Pdfjs_ocaml.get_document src
    |> Pdfjs_ocaml.Pdf_document_loading_task.promise
  in
  let* page =
    Pdfjs_ocaml.Pdf_document_proxy.get_page (pdf |> Result.get_ok) 1
  in
  let page = page |> Result.get_ok in
  let scale = 1.5 in
  let viewport = Pdfjs_ocaml.Pdf_page_proxy.get_viewport ~scale page in
  let canvas =
    Brr.El.find_first_by_selector (Jstr.v "#pdf-canvas")
    |> Option.get |> Brr_canvas.Canvas.of_el
  in
  let canvas_context = Brr_canvas.C2d.get_context canvas in
  (* Set canvas width and height *)
  let () =
    let width = Pdfjs_ocaml.Page_viewport.width viewport in
    let height = Pdfjs_ocaml.Page_viewport.height viewport in
    Brr_canvas.Canvas.set_h canvas (height |> int_of_float);
    Brr_canvas.Canvas.set_w canvas (width |> int_of_float)
  in
  let _ = Pdfjs_ocaml.Pdf_page_proxy.render page ~viewport ~canvas_context in
  Fut.return ()
